.bal-inner {
  overflow-x: scroll;
  overflow-y: hidden;
  line-height: 11.2vw;
  height: 16vw;
}
.bal-outer {
  height: 11.2vw;
  overflow: hidden;
}
.trans-rec {
  overflow-x: scroll;
  overflow-y: hidden;
  height: 35px;
  line-height: 19px;
  max-width: 29vw;
}
.trans-outer {
  height: 19px;
  overflow: hidden;
}
.font-size-09 {
  font-size: 0.9rem;
}
.refresh:active {
  opacity: 0.3;
}
.edi-address {
  width: 30vw;
  /* height: 15px; */
  outline: none;
  border-bottom: 1px solid white;
}
.scan-style {
  z-index: 99;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
}
.qrcode-waiting {
  display: flex;
  align-items: center;
  margin: auto;
  height: 100%;
}
.wallet-bg {
  background: var(--urlHome);
  background-size: cover;
  border-radius: 12px;
}
.btn-tran div {
  flex: 1;
  text-align: center;
  border: 1px solid #ebebeb;
  border-radius: 8px;
}
.add-radius {
  border-radius: 16px;
}
.addborder {
  border-bottom: 1px solid #f2f2f2;
  border-top: 1px solid #f2f2f2;
}
.v-dialog__content {
  display: flex;
  align-items: flex-end;
}
.v-dialog__content >>> .v-dialog--active {
  margin: 0 3.2vw 12px 3.2vw;
  color: red !important;
}
.v-list-group >>> .v-list-item:not(.v-list-item--disabled) {
  padding-left: 0px !important;
}
.v-list-group >>> .v-list-group__header {
  padding: 0px;
}
.records-off {
  background-color: #f7f7f7;
  color: grey;
}
.white-font {
  color: #ffffff;
}
.record-menu-l {
  font-size: 14px;
  margin-left: 14px;
  margin-right: 4px;
}
.record-menu-r {
  font-size: 12px;
  margin-right: 10px;
}
.title-balance {
  font-size: 9.6vw;
}
.rd-line2 {
  margin: 8px 0 8px 0;
}

.time-ago >>> .v-time-ago__text {
  color: #9e9e9e;
  font-size: 11px;
  font-family: "SFProText-Light", "SFProText", "SF Pro Text Light";
  font-weight: 300;
}
.send-card {
  padding: 19px 0 18px 0;
  margin-bottom: 0px;
}

.v-list-group >>> .v-list-group__header::before {
  opacity: 0 !important;
}
